    sourceMapping:
      - aliases: {}
        customSQL:
          customSQL: |-
            {{ stage('SQL Override') }}
            \NCREATE
                OR REPLACE VIEW REPORTS.VWAGGLEVEL1FORCEIDUSAGESTATS -- (LEVEL1FORCEID, LEVEL1DISPLAYACCOUNTNAME, NUMOFSUPPLIERSUSED, NUMOFCONTRACTSUSED, NUMOFCONTRACTCATEGORIESUSED, ASOFMAXRECEIPTDATE, MONTHSSINCELASTTRANSACTION, MOSTRECENTRECEIPTDATE, SUMOFSALES, SUMOFREVENUE, SUMOFREVENUE, RANKBYREVENUE, RANKBYSALES, NUMOFCONTACTS, DSSCREATETIME, DSSUPDATETIME)
            \N \NAS \NSELECT \N SALESANDREVENUE.LEVEL1FORCEID AS "LEVEL1FORCEID" \N , SALESANDREVENUE.LEVEL1DISPLAYACCOUNTNAME AS "LEVEL1DISPLAYACCOUNTNAME" \N , COUNT (DISTINCT FINANCIALREPORTINGSUPPLIERNAME) AS "NUMOFSUPPLIERSUSED" \N , COUNT (DISTINCT INITIALCONTRACTID) AS "NUMOFCONTRACTSUSED" \N , COUNT (DISTINCT CONTRACTCATEGORY) AS "NUMOFCONTRACTCATEGORIESUSED" \N , MAX(MAXRECEIPTDATE) AS "ASOFMAXRECEIPTDATE" \N , DATEDIFF(MONTH, MAX(RECEIPTDATE), MAX(MAXRECEIPTDATE)) AS "MONTHSSINCELASTTRANSACTION" \N , MAX(RECEIPTDATE) AS "MOSTRECENTRECEIPTDATE" \N , SUM(SALES) AS "SUMOFSALES" \N , SUM(REVENUE) AS "SUMOFREVENUE" \N , RANK() OVER (ORDER BY SUM(REVENUE) DESC) AS "RANKBYREVENUE" \N , RANK() OVER (ORDER BY SUM(SALES) DESC) AS "RANKBYSALES" \N , COUNT (DISTINCT DIMCONTACTKEY) AS "NUMOFCONTACTS" \N , GETDATE() AS "DSSCREATETIME" \N , GETDATE() AS "DSSUPDATETIME" \N
              FROM \N OP.OPSALESANDREVENUE AS SALESANDREVENUE \N
              LEFT OUTER JOIN DIM.CONTACT AS CONTACT
                ON \N CONTACT.LEVEL1FORCEID = SALESANDREVENUE.LEVEL1FORCEID \N -- AND ISCAPITALCONTRACT = 0 --EXCLUDE CAPITAL CONTRACTS
            \N \NGROUP BY \N SALESANDREVENUE.LEVEL1FORCEID,
                   LEVEL1DISPLAYACCOUNTNAME;\N
